math.PI = "3."
first = wrap(function(a,...)return a end)
select = wrap(select, "select")
math.factors = wrap(#where(range(2,n),nt(n%first(a,b,c)),n), "factors")
math.factorpairs = wrap(#range(2,sqrt(n),c_cat(a,n//a),n), "factorpairs")
math.primefactors = wrap(function(a,lst,i)
    lst = lst or list()
    i = i or 2
    while(i<a)do
        if(a%i == 0)then
            lst[#lst+1] = i
            return math.primefactors(a//i,lst,i)
        end
        i = i + 1
    end
    if a ~= 1 then
        lst[#lst+1] = a
    end
    return lst
end, "primefactors")
math.prime = wrap(#eq(1,len(math.primefactors(n))),"prime")

fixed = funkItUp(wrap(function(f,...)
    f = makeFunky(f)
    local old = list(...)
    local new = list()
    while true do
        new = list(f(table.unpack(old)))
        if(old == new)then
            return table.unpack(new)
        end
        old = new
    end
end,"fixed"),1)